Mỗi facebook + zalo các đ.c cần chỉnh sửa, thêm các phần sau để nâng uy tín: 
1. Làm 1 cái ảnh tường đẹp, rõ; 
2. Cần sửa phần giới thiệu: Đăng số điện thoại là số tạo facebook + 1 địa chỉ nào đó (lấy 1 cv ứng viên nào để tham khảo địa chỉ có thật; 
3. Cần điền tiểu sửa cho mỗi facebook dựa vào 1 cv ứng viên nào đó để viết cho 1 facebook cá nhân.
4. Đánh dấu vị trí là ảnh địa điểm ở của các đ.c
